import React, { Component } from "react";

import NavbarComponent from "./Components/NavbarComponent";
import HomeContainer from "./Container/HomeContainer";
import DetailContainer from "./Container/DetailContainer";
import EditContainer from "./Container/EditContainer";
import BarangContainer from "./Container/BarangContainer";
import AnalitikContainer from "./Container/AnalitikContainer";
import CreateContainer from "./Container/CreateContainer";


import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

export default class App extends Component {
  state = {
    title: "PERPASIP FRONT END",
    
  };

  render() {
    return (
      <div>
        <NavbarComponent />
        <BrowserRouter>
          <Route path="/" exact component={HomeContainer} />

          <Route path="/create" exact component={CreateUserContainer} />

          <Route path="/detail/:id" exact component={DetailUserContainer} />

          <Route path="/edit/:id" exact component={EditUserContainer} />
        </BrowserRouter>
      </div>
    )
  }
}
